    // margin: 'auto',
    padding: '30px',
    border: '1px solid #c9c9c9',
    borderRadius: '5px',
    background: '#f5f5f5',
    width: '400px',
    display: 'block',
    minHeight : '300px',
    display: "flex",
    alignItems: "center",
    justifyContent: "center"
};

const labelStyle = {
    // margin: '10px 0 5px 0',
    fontFamily: 'Arial, Helvetica, sans-serif',
    fontSize: '20px',
    backgroundColor:"green",
    borderRadius : "8px",
    margin:"25px",
    marginBottom : "20px",
    color:"white"
};


class Success extends React.Component {



    render() {
        return (
            <div style={formStyle}  >
                <div>

                    <label style={labelStyle} >{"Successfully Registered!"}</label>

                    <nav>
                            <Link to={"login"} style={{ display: 'flex', alignItems: "center", justifyContent: "center" , textDecoration:"none" }}>
                            <label >{"To login Click Here"}</label>
                            </Link>
                    </nav>
                </div>
            </div>
        )
    }
}

export default Success
